import React from "react";
import product from "../../data/product";
import './main.css'

export default prop => {

    const lass = product.map(products => {
        return (
            <table id="customers">
           <tr>

              </tr>
              <tr>
              <td>{products.id}</td>
              <td>{products.product}</td>
              <td>{products.price}</td>
              </tr>

              </table>

        );
    })

    return (
        <div>
            {lass}
        </div>
    )
}
